# Generating real brands
def generate_brands():
    brands = []
    for brand_name in real_brands:
        brand = schemas.BrandCreate(name=brand_name)
        db_brand = crud.create_brand(db=db, brand=brand)
        brands.append(db_brand)
    return brands

# Generating categories
def generate_categories():
    categories_created = []
    for category_name in categories:
        category = schemas.CategoryCreate(name=category_name)
        db_category = crud.create_category(db=db, category=category)
        categories_created.append(db_category)
    return categories_created

# Generating supermarkets
def generate_supermarkets():
    supermarkets_created = []
    for supermarket in supermarkets:
        supermarket = schemas.SupermarketCreate(
            name=supermarket["name"],
            address=supermarket["address"]
        )
        db_supermarket = crud.create_supermarket(db=db, supermarket=supermarket)
        supermarkets_created.append(db_supermarket)
    return supermarkets_created

# Generating products associated with real brands and categories
def generate_products():
    products_created = []
    for product in products:
        product_create = schemas.ProductCreate(
            name=product["name"],
            category_id=product["category_id"],
            brand_id=product["brand_id"],
            prices=product["prices"]
        )
        db_product = crud.create_product(db=db, product=product_create)
        products_created.append(db_product)
    return products_created

# Associating products with supermarkets
def associate_products_with_supermarkets():
    # Fetch all products and supermarkets from the database
    db_products = db.query(models.product.Product).all()
    db_supermarkets = db.query(models.supermarket.Supermarket).all()

    # Iterate over each product and associate it with multiple supermarkets
    for product in db_products:
        # Randomly select supermarkets to associate with each product
        num_supermarkets = random.randint(1, len(db_supermarkets))
        selected_supermarkets = random.sample(db_supermarkets, num_supermarkets)

        # Associate product with selected supermarkets
        for supermarket in selected_supermarkets:
            product.supermarkets.append(supermarket)

    # Commit the changes to the database
    db.commit()

# Executing the functions to create and associate data
try:
    generate_categories()
    generate_brands()
    generate_supermarkets()
    generate_products()
    associate_products_with_supermarkets()
    print("Banco de dados populado com sucesso!")
except Exception as e:
    print(f"Erro ao popular banco de dados: {e}")
finally:
    db.close()
